import React, { useState, useCallback } from 'react';
import styles from './banking.module.css';
import itemConfig from '../items/itemConfig.json';

const MAX_BANK_CAPACITY = 100;

function Banking({ bank = [], inventory = [], setBank, setPlayer }) {
  const [selectedItem, setSelectedItem] = useState(null);

  const handleDepositItem = useCallback((item) => {
    setPlayer((prevPlayer) => {
      let updatedInventory = [...prevPlayer.inventory];
      const itemIndex = updatedInventory.findIndex((i) => i.itemId === item.itemId);

      if (itemIndex > -1) {
        if (updatedInventory[itemIndex].quantity > 1) {
          updatedInventory[itemIndex].quantity -= 1;
        } else {
          updatedInventory.splice(itemIndex, 1);
        }
      }

      return {
        ...prevPlayer,
        inventory: updatedInventory,
      };
    });

    setBank((prevBank) => {
      let updatedBank = [...prevBank];
      const existingItemIndex = updatedBank.findIndex((i) => i.itemId === item.itemId);

      if (existingItemIndex > -1) {
        updatedBank[existingItemIndex].quantity += 1;
      } else {
        updatedBank.push({ ...item, quantity: 1 });
      }

      if (updatedBank.length > MAX_BANK_CAPACITY) {
        alert('Bank is full! Cannot deposit more items.');
        return prevBank;
      }

      return updatedBank;
    });
  }, [setPlayer, setBank]);

  const handleWithdrawItem = useCallback((item) => {
    setBank((prevBank) => {
      let updatedBank = [...prevBank];
      const itemIndex = updatedBank.findIndex((i) => i.itemId === item.itemId);

      if (itemIndex > -1) {
        if (updatedBank[itemIndex].quantity > 1) {
          updatedBank[itemIndex].quantity -= 1;
        } else {
          updatedBank.splice(itemIndex, 1);
        }
      }

      return updatedBank;
    });

    setPlayer((prevPlayer) => {
      let updatedInventory = [...prevPlayer.inventory];
      const existingItemIndex = updatedInventory.findIndex((i) => i.itemId === item.itemId);

      if (existingItemIndex > -1) {
        updatedInventory[existingItemIndex].quantity += 1;
      } else {
        updatedInventory.push({ ...item, quantity: 1 });
      }

      if (updatedInventory.length > MAX_BANK_CAPACITY) {
        alert('Inventory is full! Cannot withdraw more items.');
        return prevPlayer;
      }

      return {
        ...prevPlayer,
        inventory: updatedInventory,
      };
    });
  }, [setPlayer, setBank]);

  return (
    <div className={styles.bankingContainer}>
      <h2 className={styles.bankingTitle}>Bank</h2>
      <div className={styles.bankItems}>
        {bank.map((item, index) => (
          <div key={index} className={styles.bankItem} onClick={() => setSelectedItem(item)}>
            <img
              src={`http://localhost:5000/assets/images/items/${item?.image}`}
              alt={item?.name}
              className={styles.itemImage}
            />
            <p>(x{item?.quantity})</p>
          </div>
        ))}
      </div>
      <div className={styles.inventoryItems}>
        <h3>Your Inventory</h3>
        {inventory.map((item, index) => (
          <div key={index} className={styles.inventoryItem} onClick={() => setSelectedItem(item)}>
            <img
              src={`http://localhost:5000/assets/images/items/${item?.image}`}
              alt={item?.name}
              className={styles.itemImage}
            />
            <p>(x{item?.quantity})</p>
          </div>
        ))}
      </div>
      {selectedItem && (
        <div className={styles.itemOptions}>
          <h4>{selectedItem.name}</h4>
          {bank.some((i) => i.itemId === selectedItem.itemId) ? (
            <button onClick={() => handleWithdrawItem(selectedItem)}>Withdraw</button>
          ) : (
            <button onClick={() => handleDepositItem(selectedItem)}>Deposit</button>
          )}
          <button onClick={() => setSelectedItem(null)}>Cancel</button>
        </div>
      )}
    </div>
  );
}

export default Banking;
